style.css:
/* by hkr (dreamflame in) */

@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);
@-moz-document url-prefix("chrome://browser/content/"),url-prefix('chrome://'),url-prefix("about:"){
/* ------------------------------------ Toolbar styles \/ */
  window#main-window[sizemode="maximized"] { padding-top: 4px !important; }
  window#main-window { background-image: url('data:image/png;base64,') !important; background-repeat: repeat !important; }
  toolbox#navigator-toolbox { padding: 0px !important; }
  toolbar#TabsToolbar { background: -moz-linear-gradient(top center, rgba(80,150,255,.3) 0%, rgba(10,30,50,.1) 100%) !important; }
  toolbar#toolbar-menubar, #navigator-toolbox::after { background: transparent !important; }
  toolbar#nav-bar, #browser-bottombox {
    background: -moz-linear-gradient(top center, rgba(80,175,255,.2) 0%,  rgba(0,0,0,.1) 100%) !important;
    box-shadow: inset 0px 0px 3px 1px rgba(255,255,255,.08), 0px 0px 12px rgba(0,0,0,.6) !important;
    padding: 1px 0px 1px 0px !important;
  }
  #browser-bottombox {
    padding: 0px !important;
    color: rgba(140,160,180,.8) !important;
  }
  toolbox#navigator-toolbox toolbarbutton, #browser-bottombox findbar#FindToolbar toolbarbutton, #browser-bottombox findbar#FindToolbar checkbox {
    color: rgba(140,160,180,.8) !important;  
    -moz-appearance: none !important;
    border: 0px !important;
    opacity: .6;
    -moz-transition: opacity .4s ease-out !important;
  }
  toolbox#navigator-toolbox toolbarbutton:hover:not([disabled="true"]), #browser-bottombox findbar#FindToolbar toolbarbutton:hover:not([disabled="true"]), #browser-bottombox findbar#FindToolbar checkbox:hover:not([disabled="true"]) { opacity: 1; }
  textbox#urlbar, searchbar#searchbar textbox {
    background: -moz-linear-gradient(top center, rgba(255,255,255,.1) 0%, rgba(255,255,255,0) 100%) !important;
    border: 0px !important;
    box-shadow: inset 0px 0px 0px 1px rgba(255,255,255,.08), 0px 0px 0px 1px rgba(0,0,0,.2), 0px 0px 10px rgba(0,0,0,.5) !important;
    color: rgba(140,160,180,.8) !important;
    text-shadow: 0px 0px 5px rgba(0,0,0,1) !important;
    padding: 0px 0px 1px 0px !important;
  }
/* ------------------------------------ Toolbar styles /\ */
/* ------------------------------------ Tab styles \/ */
  tab {
    background: -moz-linear-gradient(top center, rgba(80,155,255,.1) 0%, transparent 100%) no-repeat !important; 
    color: rgba(160,200,255,.8) !important;
    text-shadow: 0px 0px 8px rgba(0,0,0,1) !important;
    box-shadow: 0px 0px 10px rgba(0,0,0,.5) !important;
  }
  tab:hover, menu:hover, menuitem:hover { background: -moz-linear-gradient(top center, rgba(80,155,255,.3) 0%, rgba(80,155,255,.1) 100%) no-repeat !important; }
  tab[selected="true"] { background: -moz-linear-gradient(top center, rgba(10,20,30,.5) 0%, rgba(100,155,245,.4) 100%) no-repeat !important; }
  tab[pinned][titlechanged]:not([selected="true"]) { background: -moz-linear-gradient(top center, rgba(80,155,255,.3) 0%, rgba(80,155,255,.1) 100%), -moz-radial-gradient(center 3px, circle cover, rgba(186,221,251,.9) 0%, rgba(186,221,251,.6) 25%, rgba(186,221,251,0)) no-repeat !important; }
  tab[pinned][titlechanged]:not([selected="true"]):hover { background: -moz-linear-gradient(top center, rgba(80,155,255,.3) 0%, rgba(80,155,255,.1) 100%), -moz-radial-gradient(center 3px, circle cover, rgba(186,221,251,1) 0%, rgba(186,221,251,1) 25%, rgba(186,221,251,0)) no-repeat !important; }
/* ------------------------------------ Tab styles /\ */
/* ------------------------------------ Identity box Styles \/ */
  box#identity-box:not(.verifiedDomain):not(.verifiedIdentity) { background: transparent !important; }
  box#identity-box.verifiedDomain {
    background: -moz-linear-gradient(top center, rgba(80,155,255,.3) 0%, rgba(20,30,60,.6) 100%) no-repeat !important;
    color: rgba(160,200,255,.8) !important;
    box-shadow: inset 0px 1px 0px hsla(215,54%,33%,.05) !important;
    text-shadow: 0px 0px 3px rgba(0,0,0,1) !important;
  }
  box#identity-box.verifiedDomain:hover {
    background: -moz-linear-gradient(top center, rgba(80,155,255,.5) 0%, rgba(20,30,60,.8) 100%) no-repeat !important;
    color: rgba(255,255,255,.8) !important;
  }
  box#identity-box.verifiedDomain[open="true"], #identity-box.verifiedDomain:hover:active {
    background: -moz-linear-gradient(top center, rgba(20,30,60,.8) 0%, rgba(80,155,255,.3) 100%) no-repeat !important;
    box-shadow: inset 0px 1px 1px hsla(215,54%,33%,.7), inset 0px 1px 3px 1px hsla(215,54%,33%,.5) !important;
  }
  box#identity-box.verifiedIdentity {
    background: -moz-linear-gradient(top center, rgba(80,255,155,.3) 0%, rgba(20,60,30,.6) 100%) no-repeat !important;
    color: rgba(160,255,200,.8) !important;
    box-shadow: inset 0px 1px 0px hsla(165,54%,33%,.05) !important;
    text-shadow: 0px 0px 3px rgba(0,0,0,1) !important;
  }
  box#identity-box.verifiedIdentity:hover {
    background: -moz-linear-gradient(top center, rgba(80,255,155,.6) 0%, rgba(20,60,30,.9) 100%) no-repeat !important;
    color: rgba(255,255,255,.8) !important;
  }
  box#identity-box.verifiedIdentity[open="true"], #identity-box.verifiedIdentity:hover:active {
    background: -moz-linear-gradient(top center, rgba(20,60,30,.9) 0%, rgba(80,255,155,.4) 100%) no-repeat !important;
    box-shadow: inset 0px 1px 1px hsla(165,54%,33%,.7), inset 0px 1px 3px 1px hsla(165,54%,33%,.5) !important;
  }
  box#notification-popup-box {
    background: url("data:image/png;base64,") center right no-repeat transparent !important;
    padding-right: 8px !important;
    padding-bottom: 1px !important;
    margin-bottom: -1px !important;
    -moz-border-image: none !important;
    box-shadow: inset 1px 0px 0px rgba(255,255,255,.06) !important;
  }
/* ------------------------------------ Identity box Styles /\ */
}
